import './task.css';

function Task() {
  return (
    <div className="task">
 <div className="card-task">
 <main>
        <section className="sectask">
          <h2>Tâche 1</h2>
          <p>Description de la tâche 1...</p>
          <p>Date limite: 20 janvier 2024</p>
        </section>
      </main>
      </div>
    </div>
  );
}

export default Task;
